import React, {Component, Fragment} from "react";
import {withRouter} from "react-router";
import {Layout} from "element-react"
class Signup extends Component {
    constructor() {
        super();
        this.state = {}
    }

    render() {
        return (<Fragment>
            <Layout.Row gutter="10">
                <Layout.Col xs="8s" sm="6" md="4" lg="3"><div className="grid-content bg-purple">取消</div></Layout.Col>
                <Layout.Col xs="4" sm="6" md="8" lg="9"><div className="grid-content bg-purple-light">登录</div></Layout.Col>
            </Layout.Row>

        </Fragment>)
    }

}

export default withRouter(Signup);
